function toDate(value: Date | string): Date {
  return typeof value === "string" ? new Date(value) : value
}

function formatDateApplied(date: Date | string) {
  return new Intl.DateTimeFormat(undefined, {
    dateStyle: "medium",
  }).format(toDate(date))
}

